import './navbar.css';
import React from 'react';
import { BrowserRouter as Router, Link } from 'react-router-dom';

import { ShoppingCart } from 'lucide-react';
import logo from '../Assets/logo.png'


const Navbar = () => {

  return (
    <Router>
      <div className="navbar">
          <img src ={logo} />
          <ul>
      
          <li onClick={()=>{setMenu("shop")}}><Link to="/" className='item'>SHOP</Link>    </li>
          <li onClick={()=>{setMenu("mens")}}><Link to="/mens" className='item'>MEN</Link>    </li>
          <li onClick={()=>{setMenu("womens")}}> <Link to="/womens" className='item'>WOMEN</Link>    </li>
          <li onClick={()=>{setMenu("kids")}}><Link to="/kids" className='item'>KIDS</Link>    </li>
          </ul>
        <Link to="/login" className='item'>LOGIN IN</Link>
        <Link to="/cart" className='item'><ShoppingCart/></Link>
      </div>
 
    </Router>
  );
};

export default Navbar;
